import React from 'react';
import { MainButton } from './Navigation';

import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>
          William Cragg
        </h1>
        <h2>
          Full-Stack Developer
        </h2>
      </header>

    </div>
  );
}

export default App;
